import Jumbotron from 'react-bootstrap/Jumbotron'



function Home() {
    return (
      <div className='home'>
        <body className='home'>

        <Jumbotron fluid>
            <h1>              David William Anderson </h1>
            <h4> Full Stack Developer </h4>
        </Jumbotron>
        </body>
      </div>
    );
  }

  export default Home;
